import "./styles/Header.css";
import "./styles/default.css";
import "./styles/Pagination.css";
import "./styles/Forms.css";
import "./styles/Main.css";
import "./styles/Categories.css";
import "./styles/Detail.css";
import Header from "./layout/Navbar";
import Main from "./components/Main";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Upload from "./posts/Upload";
import Categories from "./layout/Categories";
import Login from "./auth/Login";
import PostDetail from "./posts/PostDetail";
import Deleted from "./layout/Deleted";
import Uploaded from "./layout/Uploaded";
import Register from "./auth/Register";
import Tag from "./Tag";
import { useContext } from "react";
import axios from "axios";
import { AuthContextProvider } from "./lib/AuthContex";

axios.defaults.withCredentials = true;

function App() {

  const { loggedIn } = useContext(AudioContext)

  return (
    <AuthContextProvider>
      <Router>
        <div>
          <Header />
          <Routes>
            <Route path="/" element={<Main />} />
            <Route path="/upload" element={<Upload />} />
            <Route path="/categories" element={<Categories />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/deleted" element={<Deleted />} />
            <Route path="/post/get/:id" element={<PostDetail />} />
            <Route path="/uploaded" element={<Uploaded />} />
            <Route path="/tags/:tagName" element={<Tag />} />
          </Routes>
        </div>
      </Router>
    </AuthContextProvider>
  );
}

export default App;
